import {withAmp} from 'next/amp'
import React from 'react'
import Head from 'next/head'
const exclusive = (props) => (
    <div>
        <Head>
            <style amp-custom>
                {`
                    .addtocart_teal_banner{
                        background-color: #52bdae;
                        padding: 50px;
                        color: white; 
                        font-family: "Source Sans Pro";   
                    }
                `}
            </style>
        </Head>
        <body>
            <div class="addtocart_teal_banner">
                <p>
                    BECOME AN EXCLUSIVE MEMBER AT AN <strong>INTRODUCTORY PRICE</strong>
                </p>
            </div>
        </body>
    </div>


)

export default withAmp(exclusive , {hybrid:true})
